import "../../components/Chatbot-icon/icon";
const Home = () => {
  return (
    <>
      <section className="chat-section">
        <div className="chat-container">
          <div className="chat-content">
            <div className="chat-header">
                <Chatbot-icon/>
              <h2>Ask MLR</h2>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
